  const [measurements, setMeasurements] = useState(null);

  return (
    <div className="app">
      <h1>Sizer App POC</h1>
      <PoseDetection onMeasurement={setMeasurements} />
      <Results measurements={measurements} />
    </div>
  );
}

export default App;
